import React from 'react';
import Sidebar from '../components/Sidebar.js';
import PreNavbar from '../components/PreNavbar.js';

class CitiesPage extends React.Component {

    fetchQuotes() {
        this.setState({...this.state, isFetching: true});
        fetch("http://localhost:8080/cities/all")
        .then(response => response.json())
        .then(result => this.setState({quotes: result, isFetching: false}))
        .catch(e => console.log(e));
    }

    render() {
        return (
            <div>
                <Sidebar />
                <PreNavbar />
                <div>
                    <h1 id="header" className="cityTitle">{this.getSnapshotBeforeUpdate().result[0].name}</h1>
                </div>
            </div>
        );
    }
}

export default CitiesPage;
